import { useState } from "react";

import style from "./SearchOptionTime.module.css";

import InputCheckbox from "../../../../UI/InputCheckbox/InputCheckbox";

import { IoMdArrowDroprightCircle } from "react-icons/io";
import { IoIosArrowDropdown } from "react-icons/io";

function SearchOptionTime() {
  const [icon, setIcon] = useState(false);

  function changeIconHandler() {
    setIcon((prev) => !prev);
  }

  return (
    <div>
      <InputCheckbox
        classCheck={style.icon}
        icon={icon ? <IoMdArrowDroprightCircle /> : <IoIosArrowDropdown />}
        label="time"
        id="time"
        defaultChecked={false}
        onChange={changeIconHandler}
      />
      <div>
        <InputCheckbox label="today" id="today" defaultChecked={false} />
        <InputCheckbox
          label="yesterday"
          id="yesterday"
          defaultChecked={false}
        />
        <InputCheckbox
          label="three days ago"
          id="three days ago"
          defaultChecked={false}
        />
        <InputCheckbox
          label="a week ago"
          id="a week ago"
          defaultChecked={false}
        />
        <InputCheckbox
          label="a month ago"
          id="a month ago"
          defaultChecked={false}
        />
        <InputCheckbox
          label="three months ago"
          id="three months ago"
          defaultChecked={false}
        />
        <InputCheckbox
          label="six months ago"
          id="six months ago"
          defaultChecked={false}
        />
        <InputCheckbox
          label="a year ago"
          id="a year ago"
          defaultChecked={false}
        />
      </div>
    </div>
  );
}

export default SearchOptionTime;
